import React from 'react';
import './page-header.scss';

export default function PageHeader() {
  const style = {
    width: '100%',
    height: '100px',
    textAlign: 'center',
    backgroundColor: '#1a1a1a',
    position: 'absolute',
    left: '0',
    top: '0',
    color: '#ff5454'
  };

  return (
    <div className={'page-header-container'} style={style}>
      <h1>My Kanban</h1>
      <span>Let`s Code</span>
    </div>
  );
}
